description:
The Tomorrow People are 'homo superiors', the next stage of human evolution. They have special powers including telekinetic abilities and teleportation skills, commonly known as &quot;Jaunting&quot;. They are assisted in their adventures by a futuristic talking computer called Tim.

The Tomorrow People ran for nearly six years and over the years we see a number of ' Tomorrow People' depart the show. However one member of the team remained throughout the series and that's John played by actor Nicholas Young, he is in all 68 episodes.


